double VenusTopography::getTopographicHeight(greal lat, greal lon) {
  // Get the surface height 
  double topoHeight = Topography::getTopographicHeight(lat, lon);

  // Assuming there is no callback function, correct the surface 
  // height wrt radius 6051.848 to be wrt referenece radius 6051.8
  if (getTopographicHeightCallback == nullptr) {
    topoHeight += 0.048;
  }

  // If there is a callback function, the user is responsible for
  // making any necessary adjustments.
  return topoHeight;
}

